css:
@-moz-document domain("freeproxylists.net") {
html {
    background-color: #242424;
}

body, td {
    color: #dedede;
}

.DataGrid tr.Caption td {
    background-color: #313030;
}

.DataGrid tr.Even {
    background-color: #252528;
}

.DataGrid tr.Odd {
    background-color: #252528;
}

.DataGrid td {
    border: 1px solid #39393e;
    color: #dedede;
}

table.DataGrid tr:hover {
    background-color: #2f2f2f;
}

a, a:visited {
    color: #dedede;
}

.DataGrid tr.OddRead {
    background-color: #252528;
}

.DataGrid tr.EvenRead {
    background-color: #252528;
}

input, select, textarea {
    background-color: #272727;
    color: #dedede;
}

.form, .form_set input, .form_set select, .form_set textarea {
    border-right: #464646 1px solid;
    border-top: #464646 1px solid;
    border-left: #464646 1px solid;
    border-bottom: #464646 1px solid;
    background-color: #313030;
    color: #dedede;
}

div.page span.current {
    background-color: #383838;
    color: #dedede;
}
}
